import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  FiAlertCircle, 
  FiUserPlus, 
  FiClock, 
  FiPercent, 
  FiEye, 
  FiRefreshCw,
  FiSearch,
  FiFilter,
  FiCalendar,
  FiUser,
  FiTrash2,
  FiDownload
} from 'react-icons/fi';
import LoadingSpinner from '../components/LoadingSpinner';
import Notification from '../components/Notification';

const API_URL = 'http://localhost:5000';

const UnknownFaces = () => {
  const [unknowns, setUnknowns] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterDate, setFilterDate] = useState('');
  const [notification, setNotification] = useState(null);

  useEffect(() => {
    fetchUnknowns();
  }, []);

    const fetchUnknowns = async () => {
      try {
        setLoading(true);
        const response = await fetch(`${API_URL}/api/unknown_faces`);
        if (!response.ok) {
          throw new Error('Failed to fetch unknown faces');
        }
        const data = await response.json();
        setUnknowns(data);
      } catch (err) {
        setError(err.message);
      showNotification('error', 'Error', err.message);
      } finally {
        setLoading(false);
      }
    };

  const showNotification = (type, title, message) => {
    setNotification({ type, title, message });
    setTimeout(() => setNotification(null), 5000);
  };

  const filteredUnknowns = unknowns.filter(face => {
    const matchesSearch = face.label?.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         face.id.toString().includes(searchTerm);
    const matchesDate = !filterDate || face.timestamp?.startsWith(filterDate);
    return matchesSearch && matchesDate;
  });

  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this unknown face?')) {
      try {
        const response = await fetch(`${API_URL}/api/unknown_faces/${id}`, {
          method: 'DELETE',
        });
        if (!response.ok) {
          throw new Error('Failed to delete unknown face');
        }
        showNotification('success', 'Deleted', 'Unknown face has been removed.');
        setUnknowns(unknowns.filter(face => face.id !== id));
      } catch (err) {
        showNotification('error', 'Error', 'Failed to delete unknown face.');
      }
    }
  };

  const renderContent = () => {
    if (loading) {
      return (
        <div className="flex justify-center items-center py-20">
          <LoadingSpinner size="lg" text="Loading unknown faces..." />
        </div>
      );
    }

    if (error) {
      return (
        <div className="glass-card p-12 text-center">
          <FiAlertCircle className="mx-auto text-6xl text-red-500 mb-4" />
          <h3 className="text-xl font-semibold text-gray-800 dark:text-white mb-2">Failed to load data</h3>
          <p className="text-gray-600 dark:text-gray-300">{error}</p>
          <button 
            onClick={fetchUnknowns}
            className="btn-primary mt-4"
          >
            <FiRefreshCw className="mr-2" />
            Try Again
          </button>
        </div>
      );
    }
    
    if (filteredUnknowns.length === 0) {
      return (
        <div className="glass-card p-12 text-center">
          <FiEye className="mx-auto text-6xl text-gray-400 mb-4" />
          <h3 className="text-xl font-semibold text-gray-800 dark:text-white mb-2">
            {unknowns.length === 0 ? 'No Unknown Faces Detected' : 'No Results Found'}
          </h3>
          <p className="text-gray-600 dark:text-gray-300">
            {unknowns.length === 0 
              ? 'The system hasn\'t detected any unrecognized individuals yet.'
              : 'Try adjusting your search or filter criteria.'
            }
          </p>
        </div>
      );
    }

    return (
      <div className="glass-card overflow-x-auto p-0">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gradient-to-r from-red-100 to-pink-100">
            <tr>
              <th className="px-4 py-3 text-left text-xs font-medium text-gray-700 uppercase tracking-wider">Photo</th>
              <th className="px-4 py-3 text-left text-xs font-medium text-gray-700 uppercase tracking-wider">ID</th>
              <th className="px-4 py-3 text-left text-xs font-medium text-gray-700 uppercase tracking-wider">Label</th>
              <th className="px-4 py-3 text-left text-xs font-medium text-gray-700 uppercase tracking-wider">Timestamp</th>
              <th className="px-4 py-3 text-left text-xs font-medium text-gray-700 uppercase tracking-wider">Confidence</th>
              <th className="px-4 py-3 text-center text-xs font-medium text-gray-700 uppercase tracking-wider">Actions</th>
            </tr>
          </thead>
          <tbody className="bg-white/60 divide-y divide-gray-200">
            {filteredUnknowns.map((face) => {
              const filename = face.representative_image_path?.split('/').pop() || face.image_path?.split('/').pop();
              return (
                <tr key={face.id} className="hover:bg-red-50/60 transition">
                  <td className="px-4 py-2">
                    <img
                      src={`${API_URL}/${face.representative_image_path || face.image_path}`}
                      alt="Unknown Face"
                      className="w-14 h-14 object-cover rounded-lg border border-gray-200 shadow"
                    />
                  </td>
                  <td className="px-4 py-2 text-gray-700 font-semibold">{face.id}</td>
                  <td className="px-4 py-2 text-gray-700">{face.label || `Unknown-${face.id}`}</td>
                  <td className="px-4 py-2 text-gray-700">{new Date(face.timestamp || face.last_seen).toLocaleString()}</td>
                  <td className="px-4 py-2 text-gray-700">{face.confidence ? `${(face.confidence * 100).toFixed(1)}%` : '-'}</td>
                  <td className="px-4 py-2 text-center">
                    <div className="flex items-center justify-center gap-2">
                      <Link to={`/enroll/${filename}`} className="p-2 rounded-full bg-blue-500/80 hover:bg-blue-600 text-white" title="Enroll">
                        <FiUserPlus size={16} />
                      </Link>
                      <button onClick={() => handleDelete(face.id)} className="p-2 rounded-full bg-red-500/80 hover:bg-red-600 text-white" title="Delete">
                        <FiTrash2 size={16} />
                      </button>
                    </div>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-pink-100 via-white to-red-100 py-8 px-2 fade-in relative overflow-x-hidden">
      {/* Animated floating background highlights */}
      <div className="pointer-events-none select-none">
        <div className="absolute top-10 left-1/3 w-1/3 h-32 bg-gradient-to-r from-pink-400/30 to-red-400/20 rounded-full blur-3xl animate-pulse"></div>
        <div className="absolute bottom-10 right-1/4 w-1/4 h-24 bg-gradient-to-l from-red-400/30 to-pink-400/20 rounded-full blur-2xl animate-pulse"></div>
      </div>
      <div className="relative z-10 max-w-6xl mx-auto flex flex-col gap-8">
        {/* Header - bold, glass, floating */}
        <div className="glass-card p-8 rounded-3xl shadow-2xl flex flex-col md:flex-row md:items-center md:justify-between gap-6 border-2 border-pink-200/60">
          <div className="flex items-center gap-4">
            <div className="p-4 rounded-2xl bg-gradient-to-br from-red-500 to-pink-500 text-white shadow-lg">
              <FiEye size={32} />
            </div>
            <div>
              <h1 className="text-4xl font-extrabold gradient-text mb-1 tracking-tight">Unknown Faces</h1>
              <p className="text-lg text-gray-600 dark:text-gray-300 font-medium">Manage and enroll unidentified individuals</p>
            </div>
          </div>
          <button 
            onClick={fetchUnknowns}
            className="btn-primary px-6 py-3 text-lg rounded-xl shadow-lg flex items-center gap-2 font-semibold"
            disabled={loading}
          >
            <FiRefreshCw className={`mr-2 ${loading ? 'animate-spin' : ''}`} />
            Refresh
          </button>
        </div>

        {/* Filters - distinct, glass, floating */}
        <div className="glass-card p-6 rounded-2xl shadow-xl border-2 border-pink-100/60 max-w-4xl w-full mx-auto mb-2">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="relative">
              <FiSearch className="absolute left-4 top-1/2 transform -translate-y-1/2 text-pink-400 text-xl" />
              <input
                type="text"
                placeholder="Search by ID or label..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="enhanced-input pl-12 text-lg rounded-xl border-2 border-pink-200 focus:border-pink-400 transition"
              />
            </div>
            <div className="relative">
              <FiCalendar className="absolute left-4 top-1/2 transform -translate-y-1/2 text-pink-400 text-xl" />
              <input
                type="date"
                value={filterDate}
                onChange={(e) => setFilterDate(e.target.value)}
                className="enhanced-input pl-12 text-lg rounded-xl border-2 border-pink-200 focus:border-pink-400 transition"
              />
            </div>
          </div>
        </div>

        {/* Stats Cards - large, vibrant, glass */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <div className="glass-card p-8 rounded-2xl text-center shadow-lg border-2 border-pink-100/60">
            <div className="text-4xl font-extrabold text-gray-800 dark:text-white mb-2">{unknowns.length}</div>
            <div className="text-lg text-gray-600 dark:text-gray-300 font-medium">Total Unknown</div>
          </div>
          <div className="glass-card p-8 rounded-2xl text-center shadow-lg border-2 border-pink-100/60">
            <div className="text-4xl font-extrabold text-gray-800 dark:text-white mb-2">{filteredUnknowns.length}</div>
            <div className="text-lg text-gray-600 dark:text-gray-300 font-medium">Filtered Results</div>
          </div>
          <div className="glass-card p-8 rounded-2xl text-center shadow-lg border-2 border-pink-100/60">
            <div className="text-4xl font-extrabold text-gray-800 dark:text-white mb-2">
              {unknowns.length > 0 ? Math.round((filteredUnknowns.length / unknowns.length) * 100) : 0}%
            </div>
            <div className="text-lg text-gray-600 dark:text-gray-300 font-medium">Match Rate</div>
          </div>
        </div>

        {/* Content - table in a floating glass card, more interactive */}
        <div className="glass-card p-0 rounded-2xl shadow-2xl border-2 border-pink-100/60 overflow-x-auto">
          {renderContent()}
        </div>

        {/* Notification */}
        {notification && (
          <Notification
            type={notification.type}
            title={notification.title}
            message={notification.message}
            onClose={() => setNotification(null)}
          />
        )}
      </div>
    </div>
  );
};

export default UnknownFaces;
